import React, { Component } from 'react';
import "./Home.css";

class Home extends Component{
    render() {
        return(
            <div>
                <h1>Home</h1>
                <div id="fundo-externo">
                    <div id="fundo">
                        <img src="./images/fundo.jpeg" alt="" />
                    </div>
                </div>
            </div>)
        ;
    }

}

export default Home;
